    /**
     * @param  list<int|float>  $input
     */
    public static function calculateMedian(array $input): int|float
    {
        sort($input, SORT_NUMERIC);

        if (count($input) % 2 === 0) {
            return ($input[(count($input) / 2) - 1] + $input[count($input) / 2]) / 2;
        }

        return $input[(int) floor(count($input) / 2)];
    }

    /**
     * @param  array{int, int}  $a
     * @param  array{int, int}  $b
     * @return array{int, int}
     */
    public static function addUnsignedLongLong(array $a, array $b): array
    {
        $a[1] += $b[1];

        $a[0] += $a[1] >> 32;
        $a[1] &= 0xFFFFFFFF;

        $a[0] += $b[0];
        $a[0] &= 0xFFFFFFFF;

        return $a;
    }

    /**
     * @param  list<int>  $bits
     */
    public static function encodeBitsToHash(array $bits): string
    {
        $hash = '';
        foreach (array_chunk($bits, 32) as $byte) {
            $hash .= dechex(bindec(implode('', $byte)));
        }

        return $hash;
    }

    public static function calculateHashHammingDistance(string $a, string $b): int
    {
        return count(array_diff_assoc(self::decodeHashToBits($a), self::decodeHashToBits($b)));
    }

    /**
     * Calculate the 2D DTC of a 64x64 matrix and return the top 8x8 as a flat list
     *
     * @param  list<list<int|float>>  $input
     * @return list<int|float>
     */
    public static function calculateDct2dFast64(array $input): array
    {
        $rows = [];
        for ($y = 0; $y < 64; $y++) {
            $rows[$y] = self::calculateDct1dFast64($input[$y]);
        }

        $matrix = [];

        // We only need to do the first 8 here, as we throw away the rest of the output
        $col = [];
        for ($x = 0; $x < 8; $x++) {
            for ($y = 0; $y < 64; $y++) {
                $col[$y] = $rows[$y][$x];
            }

            $matrix[$x] = self::calculateDct1dFast64($col);
        }
        unset($col);

        $flattened = [];
        for ($y = 0; $y < 8; $y++) {
            for ($x = 0; $x < 8; $x++) {
                $flattened[] = $matrix[$x][$y];
            }
        }

        return $flattened;
    }

    /**
     * @return list<int>
     */
    private static function decodeHashToBits(string $hash): array
    {
        return array_merge(...array_map(function (string $chunk): array {
            return str_split(str_pad(decbin(hexdec($chunk)), 32, '0', STR_PAD_LEFT));
        }, str_split($hash, 8)));
    }

    /**
     * @param  list<int|float>  $input
     * @return list<int|float>
     */
    private static function calculateDct1dFast64(array $input): array
    {
        if (count($input) !== 64) {
            throw new \LogicException('Input array must have 64 elements');
        }

        $transformed = [];

        for ($i = 0; $i < 64; $i++) {
            $sum = 0;
            for ($j = 0; $j < 64; $j++) {
                $sum += $input[$j] * self::DCT_64_COEFFICIENTS[$i][$j];
            }

            $transformed[$i] = $sum;
        }

        return $transformed;
    }
